INSERT INTO `enhancement_table` VALUES (2,'-71.072830','42.506485','Wakefield massacre','Michael McDermott, 42, opened fire on co-workers at Edgewater Technology and was later arrested.'),(17,'-82.458443','27.947760','Hotel shooting','Hotel employee Silvio Leyva, 36, gunned down four coworkers at the Radisson Bay Harbor Inn before killing a woman outside who refused to give him her car. He was arrested shortly after the shootings.'),(18,'-157.847305','21.325512','Xerox killings','Byran Koji Uyesugi, 40, a Xerox service technician, opened fire inside the building with a 9mm Glock. He fled and was later apprehended by police.'),(19,'-97.470673','32.693398','Wedgwood Baptist Church shooting','Larry Gene Ashbrook, 47, opened fire inside the Wedgwood Baptist Church during a prayer rally before committing suicide.'),(20,'-84.390182','33.749100','Atlanta day trading spree killings','Day trader Mark O. Barton, 44, who had recently lost a substantial sum of money, went on a shooting spree through two day-trading firms. He started at the All-Tech Investment Group, where he worked, then went on to Momentum Securities. He fled and hours later, after being cornered by police outside a gas station, committed suicide. (Two days before the spree, he killed his wife and two children with a hammer.)'),(21,'-104.987724','39.602108','Columbine High School massacre','Eric Harris, 18, and Dylan Klebold, 17, opened fire throughout Columbine High School before committing suicide.'),(24,'-85.311821','35.047157','Chattanooga military recruitment center','Kuwaiti-born Mohammod Youssuf Abdulazeez, 24, a naturalized US citizen, opened fire at a Naval reserve center, and then drove to a military recruitment office where he shot and killed four Marines and a Navy service member, and wounded a police officer and another military service member. He was then fatally shot in an exchange of gunfire with law enforcement officers responding to the attack.'),(25,'-123.022026','44.046238','Thurston High School shooting','After he was expelled for having a gun in his locker, Kipland P. Kinkel, 15, a freshman at Thurston High, went on a shooting spree, killing his parents at home and two students at school. Five classmates wrestled Kipland to the ground before he was arrested.'),(26,'-79.933144','32.788387','Charleston Church Shooting','Dylann Storm Roof, 21, shot and killed 9 people after opening fire at the Emanuel AME Church in Charleston, South Carolina. According to a roommate, he had allegedly been planning something like that for six months.\"'),(27,'-90.668259','35.820988','Westside Middle School killings','Mitchell Scott Johnson, 13, and Andrew Douglas Golden, 11, two juveniles, ambushed students and teachers as they left the school they were apprehended by police at the scene.'),(29,'-72.729836','41.685631','Connecticut Lottery shooting','Lottery worker Matthew Beck, 35, gunned down four bosses over a salary dispute before committing suicide.'),(30,'-117.853111','33.787796','Caltrans maintenance yard shooting','Former Caltrans employee Arturo Reyes Torres, 41, opened fire at a maintenance yard after he was fired for allegedly selling government materials he\'d stolen from work. He was shot dead by police.'),(31,'-122.176918','48.050823','Marysville-Pilchuck High School shooting','Jaylen Fryberg, 15, using a .40-caliber Berretta, shot five \r\nstudents at Marysville High School, including two of his cousins and three friends, killing all but one. Fryberg arranged to meet them for lunch in the school cafeteria by text. Fryberg was reportedly well-liked at the school and there was not believed to be any ill-will between him and his victims. He committed suicide at the scene.'),(34,'-81.721954','33.559860','R.E. Phelon Company shooting','Ex-con Hastings Arthur Wise, 43, opened fire at the R.E. Phelon Company in retaliation for being fired after an argument with a supervisor. He attempted suicide by ingesting insecticide, failed, and was executed by the state of South Carolina eight years later.'),(35,'-120.542236','41.487103','Alturas tribal shooting','Cherie Lash Rhoades, 44, opened fire at the Cedarville Rancheria Tribal Office and Community Center, killing four and wounding two. After running out of ammunition, Rhoades grabbed a butcher knife and stabbed another person.'),(36,'-76.994530','38.874981','Washington Navy Yard shooting','Aaron Alexis, 34, a military veteran and contractor from Texas, opened fire in the Navy installation, killing 12 people and wounding 8 before being shot dead by police.'),(37,'-80.143379','26.122309','Fort Lauderdale revenge shooting','Fired city park employee Clifton McCree, 41, opened fire on former coworkers he called \"racist devils\" inside their municipal trailer in an act of revenge after failing a drug test. He then committed suicide.'),(38,'-97.417397','27.823713','Walter Rossler Company massacre','Disgruntled former metallurgist James Daniel Simpson, 28, opened fire throughout the Walter Rossler Company where he had worked before exiting the building and committing suicide.'),(39,'-117.648361','47.618645','Air Force base shooting','Former airman Dean Allen Mellberg, 20, opened fire inside a hospital at the Fairchild Air Force Base before he was shot dead by a military police officer outside.'),(40,'-80.291466','25.867010','Hialeah apartment shooting','Pedro Vargas, 42, set fire to his apartment, killed six people in the complex, and held another two hostages at gunpoint before a SWAT team stormed the building and fatally shot him.'),(41,'-118.494751','34.008617','Santa Monica rampage','John Zawahri, 23, armed with a homemade assault rifle and high-capacity magazines, killed his brother and father at home and then headed to Santa Monica College, where he was eventually killed by police.'),(42,'-104.835869','39.754711','Chuck E. Cheese\'s killings','Nathan Dunlap, 19, a recently fired Chuck E. Cheese\'s employee, went on a rampage through his former workplace and was arrested the following day. He now awaits execution on death row.'),(43,'-122.339363','47.312962','Pinewood Village Apartment shooting','Dennis Clark III, 27, shot and killed his girlfriend in their shared apartment, and then shot two witnesses in the building\'s parking lot and a third victim in another apartment, before being killed by police.'),(44,'-73.634293','40.726768','Long Island Rail Road massacre','Colin Ferguson, 35, opened fire on an eastbound Long Island Rail Road train as it approached a Garden City station. He was later arrested.'),(45,'-78.878708','35.052994','Luigi\'s shooting','Army Sgt. Kenneth Junior French, 22, opened fire inside Luigi\'s Italian restaurant while ranting about gays in the military before he was shot and arrested by police.'),(46,'-74.984894','43.045601','Mohawk Valley shootings','Kurt Myers, 64, shot six people in neighboring towns, killing two in a barbershop and two at a car care business, before being killed by officers in a shootout after a nearly 19-hour standoff.'),(47,'-122.419197','37.778961','101 California Street shootings','Failed businessman Gian Luigi Ferri, 55, opened fire throughout an office building before he committed suicide inside as police pursued him.'),(48,'-73.311424','41.412323','Sandy Hook Elementary massacre','Adam Lanza, 20, shot his mother dead at their home then drove to Sandy Hook Elementary school. He forced his way inside and opened fire, killing 20 children and six adults before committing suicide.'),(49,'-122.036346','37.368832','ESL shooting','Former ESL Incorporated employee Richard Farley, 39, gunned down seven people at his former workplace. He was later arrested and now sits on death row at San Quentin.'),(50,'-93.265472','44.977299','Accent Signage Systems shooting','Andrew Engeldinger, 36, upon learning he was being fired, went on a shooting rampage, killing the business owner, three fellow employees, and a UPS driver. He then killed himself.'),(51,'-76.870575','42.381054','Watkins Glen killings','John T. Miller, 50, killed four child-support workers in a county office building before turning the gun on himself.  Miller was upset about a court order garnishing his paycheck to cover overdue child-support payments.'),(52,'-80.642967','28.033188','Shopping centers spree killings','Retired librarian William Cruse, 59, was paranoid neighbors gossiped that he was gay. He drove to a Publix supermarket, killing two Florida Tech students en route before opening fire outside and killing a woman. He then drove to a Winn-Dixie supermarket and killed three more, including two police officers. Cruse was arrested after taking a hostage and died on death row in 2009.'),(53,'-121.547577','39.078686','Lindhurst High School shooting','Former Lindhurst High School student Eric Houston, 20, angry about various personal failings, killed three students and a teacher at the school before surrendering to police after an eight-hour standoff. He was later sentenced to death.'),(54,'-87.863136','42.885849','Sikh temple shooting','U.S. Army veteran Wade Michael Page, 40, opened fire in a Sikh gurdwara before he died from a self-inflicted gunshot would during a shootout with police.'),(55,'-97.429367','35.667202','United States Postal Service shooting','Postal worker Patrick Sherrill, 44, opened fire at a post office before committing suicide.'),(56,'-83.144646','42.489479','Royal Oak postal shootings','Laid-off postal worker Thomas McIlvane, 31, opened fire at his former workplace before committing suicide.'),(57,'-117.043083','32.552002','San Ysidro McDonald\'s massacre','James Oliver Huberty, 41, opened fire in a McDonald\'s restaurant before he was shot dead by a police officer.'),(58,'-91.530220','41.660690','University of Iowa shooting','Former graduate student Gang Lu, 28, went on a rampage on campus and then committed suicide at the scene.'),(59,'-97.727798','31.117119','Luby\'s massacre','George Hennard, 35, drove his pickup truck into a Luby\'s cafeteria and opened fire before committing suicide.'),(60,'-96.800011','32.780106','Dallas nightclub shooting','Abdelkrim Belachheb, 39, opened fire at an upscale nightclub after a woman rejected his advances. He was later arrested.'),(61,'-80.226685','25.796492','Welding shop shooting','Junior high school teacher Carl Robert Brown, 51, opened fire inside a welding shop and was later shot dead by a witness as he fled the scene.'),(62,'-81.655647','30.332184','GMAC massacre','James Edward Pough, 42, opened fire at a General Motors Acceptance Corporation office before committing suicide. (The day prior, Pough killed a pimp and prostitute and injured two others. Those victims are not included in the mass murder count.)'),(63,'-85.759407','38.254238','Standard Gravure shooting','Joseph T. Wesbecker, 47, gunned down eight people at his former workplace before committing suicide.'),(64,'-121.290779','37.957703','Stockton schoolyard shooting','Patrick Purdy, 26, an alcoholic with a police record, launched an assault at Cleveland Elementary School, where many young Southeast Asian immigrants were enrolled. Purdy killed himself with a shot to the head.'),(65,'-104.823486','39.709282','Aurora theater shooting','James Holmes, 24, opened fire in a movie theater during the opening night of \"The Dark Night Rises\" and was later arrested outside.'),(66,'-122.330063','47.603832','Seattle cafe shooting','Ian Stawicki, 40, gunned down four patrons at a cafe, and another person during a carjacking nearby, then shot himself as police closed in. (He died later that day in a Seattle hospital.)'),(67,'-122.270813','37.804382','Oikos University killings','One L. Goh, 43, a former student, opened fire in a nursing classroom. He fled the scene by car and was arrested nearby a few hours later.'),(68,'-84.213531','33.941212','Su Jung Health Sauna shooting','Jeong Soo Paek, 59, returned to a Korean spa from which he\'d been kicked out after an altercation. He gunned down two of his sisters and their husbands before committing suicide.'),(69,'-118.104637','33.741177','Seal Beach shooting','Scott Evans Dekraai, 42, opened fire inside a hair salon and was later arrested.'),(70,'-119.767403','39.163799','IHOP shooting','Eduardo Sencion, 32, opened fire at an International House of Pancakes restaurant and later died from a self-inflicted gunshot wound.'),(71,'-110.926476','32.221745','Tucson shooting','Jared Loughner, 22, opened fire outside a Safeway during a constituent meeting with Congresswoman Gabrielle Giffords (D-Ariz.) before he was subdued by bystanders and arrested.'),(72,'-72.521477','41.775932','Hartford Beer Distributor shooting','Omar S. Thornton, 34, shot up his Hartford Beer Distributor workplace after facing disciplinary issues, then committed suicide.'),(73,'-122.437035','47.155846','Coffee shop police killings','Maurice Clemmons, 37, a felon who was out on bail for child-rape charges, entered a coffee shop on a Sunday morning and shot four police officers who had gone there to use their laptops before their shifts. Clemmons, who was wounded fleeing the scene, was later shot dead by a police officer in Seattle after a two-day manhunt.'),(74,'-97.771568','31.201130','Fort Hood massacre','Army psychiatrist Nidal Malik Hasan, 39, opened fire on an Army base in an attack linked to Islamist extremism. Hasan was injured during the attack and later arrested.'),(75,'-75.917976','42.098686','Binghamton shootings','Jiverly Wong, 41, opened fire at an American Civic Association center for immigrants before committing suicide.'),(76,'-79.417053','35.345802','Carthage nursing home shooting','Robert Stewart, 45, opened fire at a nursing home where his estranged wife worked before he was shot and arrested by a police officer.'),(77,'-87.557373','37.767208','Atlantis Plastics shooting','Disgruntled employee Wesley Neal Higdon, 25, shot up an Atlantis Plastics factory after he was escorted out of his workplace for an argument with a supervisor. Higdon shot the supervisor outside the factory before opening fire on coworkers inside. He then committed suicide.'),(78,'-88.750366','41.929474','Northern Illinois University shooting','Steven Kazmierczak, 27, opened fire in a lecture hall, then shot and killed himself before police arrived.'),(79,'-90.406784','38.583385','Kirkwood City Council shooting','Charles \"Cookie\" Lee Thornton, 52, went on a rampage at the city hall before being shot and killed by police.'),(80,'-95.937874','41.258732','Westroads Mall shooting','Robert A. Hawkins, 19, opened fire inside Westroads Mall before committing suicide.'),(81,'-88.902893','45.571907','Crandon shooting','Off-duty sheriff\'s deputy Tyler Peterson, 20, opened fire inside an apartment after an argument at a homecoming party. He fled the scene and later committed suicide.'),(82,'-80.413940','37.229572','Virginia Tech massacre','Virginia Tech student Seung-Hui Cho, 23, opened fire on his school\'s campus before committing suicide.'),(83,'-111.891090','40.760647','Trolley Square shooting','Sulejman Talovi, 18, rampaged through the shopping center until he was shot dead by police.'),(84,'-76.080597','39.958900','Amish school shooting','Charles Carl Roberts, 32, shot 10 young girls in a one-room schoolhouse in Bart Township, killing 5, before taking his own life.'),(85,'-122.316498','47.622898','Capitol Hill massacre','Kyle Aaron Huff, 28, opened fire at a rave afterparty in the Capitol Hill neighborhood of Seattle before committing suicide.'),(86,'-119.871437','34.436283','Goleta postal shootings','Former postal worker Jennifer Sanmarco, 44, shot dead a former neighbor then drove to the mail processing plant where she used to work. Inside, she opened fire, killing six employees before committing suicide.'),(87,'-95.016937','47.876347','Red Lake massacre','Jeffrey Weise, 16, murdered his grandfather, who was a police officer, and grandfather\'s girlfriend. Weise then drove his grandfather\'s squad car to Red Lake Senior High School and opened fire on the reservation campus, killing another seven people before committing suicide.'),(88,'-88.106476','43.060566','Living Church of God shooting','Living Church of God member Terry Michael Ratzmann, 44, opened fire at a church meeting at a Sheraton hotel before committing suicide.'),(89,'-83.000710','39.962261','Damageplan show shooting','Nathan Gale, 25, possibly upset about the breakup of Pantera, gunned down former Pantera guitarist Dimebag Darrell and three others at a Damageplan show before a police officer fatally shot Gale.'),(90,'-88.689781','32.376080','Lockheed Martin shooting','Assembly line worker Douglas Williams, 48, opened fire at his Lockheed Martin workplace in a racially motivated attack before committing suicide.'),(91,'-87.856728','41.900585','Navistar shooting','Fired employee William D. Baker, 66, opened fire at his former Navistar workplace before committing suicide.');
