CREATE TABLE `mental_health` (
  `case_id` int NOT NULL,
  `prior_signs_reported` varchar(45) COLLATE utf8mb3_bin DEFAULT NULL,
  `has_details` varchar(4) COLLATE utf8mb3_bin DEFAULT NULL,
