INSERT INTO `mental_health_details` VALUES (1,'Perpetrator\'s history unclear. In 1969 Paddock\'s father was classified by the FBI as a dangerous psychopath with suicidal tendencies psychopathy can be heritable (see Mother Jones sourcing).'),(2,'Psychiatrist guessed he had schizophrenia, but McDermott had researched how to fake a mental illness on the internet. Defense lawyer described history of suicide attempts and mental illness dating back to teen years. Jury rejected his insanity defense.'),(3,'Lam had a history of domestic, work conflict'),(7,'Hartless had a violent criminal history his former girlfriend had submitted a letter in court recently stating that he had \"a severe mental disorder.\"'),(10,'Among other signs, Santiago had gone to a FBI office in Anchorage and complained that his mind was being controlled by the CIA.'),(11,'According to the Cetin\'s stepfather he had \"mental health issues\" court records showed that he suffered from anxiety and depression.'),(16,'The judge in the case has not publicly released Dear\'s medical and mental health records. As of April 5, 2016 Dear was undergoing a competency evaluation. Dear had a history of disputes with his relatives and neighbors. At a hearing in December 2015, he said, \"I am a warrior for the babies.\"'),(17,'His brother called him \"unbalanced\" and mentally ill.'),(18,'A psychiatrist, testifying for the prosecution,said he suffered from schizophrenia.'),(19,'His siblings decribed him as a paranoid schizophrenic.'),(20,'In letters, he details his deep depression and downward spiral.'),(21,'Harris was an alleged psychopath Klebold was depressed and suicidal.'),(22,'Prior to the rampage, Harpham wrote an \"incoherent\" blog and rambled \"nonsensically\" in a YouTube video about mind control techniques and God, according to the Denver Post. He had a history of drug and alcohol abuse.'),(23,'Harper-Mercer\'s mother said in multiple online postings that he had Asperger\'s syndrome. Harper-Mercer graduated from the Switzer Learning Center, a school for students with special needs, emotional difficulties, autism and Asperger\'s syndrome.'),(24,'Abdulazeez \"had suffered for years from depression and possibly from bipolar disorder,\" according to a representative of the family. (NYT, July 20 2015)'),(25,'Doctors testified that he was a paranoid schizophrenic who suffered from hallucinations'),(27,'Boys displayed unruly and aggressive behavior. They picked on kids and made threats about killing people.'),(28,'While serving in the Air Force, he went to an emergency walk-in clinic because of concerns over his mood swings, and had either sought or been ordered to behavioral health interventions, according to Fox 6 Now. In a 2014 risk assessment with a psychologist at an outpatient clinic in Appleton, Valencia del Toro recalled thinking previously: \"If I\'m gonna take myself out, I might as well take other people with me.\" The police report obtained by Fox 6 says that Valencia del Toro had a history of depression, suicidal and occassionally homicidal thoughts, and alcoholism. He was intoxicated on the day of the shooting.'),(29,'He had been hospitalized for psychiatric reasons and had a history of depression'),(30,'He was disgruntled after being fired.'),(31,'Fryberg was well-liked and allegedly happy, but was also upset about a girl and had posted emotional social media messages. No definitive signs of mental health problems.'),(32,'Rodger was never hospitalized due to mental illness, but had a long history of mental health issues dating back to his childhood, and received treatment from multiple counselors leading up to his rampage. According to The Independent, Rodger had considered suicide but had no history of violence. Just before his rampage, he sent a 137-page manifesto to multiple people.'),(33,'Lopez \"had a long history of troubling behavior,\" according to the Washington Post, including a history of decieving others, problems in his personal life, and financial difficulties. However, officials found that Lopez exhibited no signals that he could be violent. In the year leading up to the attack, he sought treatment for medical and behavioral health ailments.'),(34,'An ex-con, he had been freed from prison, although he displayed violent tendencies.'),(36,'Had told Rhode Island police the prior month that he\'d \"heard voices\" had been undergoing mental health treatment with Veterans Affairs since August 2013.'),(37,'Co-workers complained about his threats and verbal abuse. His supervisors asked him to get a psychiatric evaluation. He lost his job, which relatives said drove his depression.'),(38,'He was likely angry because he was given an assignment at work he didn\'t like. But acquaintances didn\'t know why he\'d come back and kill.'),(39,'He was repeatedly diagnosed with emotional problems during his two years of service.'),(40,'His mother told authorities her son had been acting strangely and needed a psychiatric evaluation.'),(41,'He was known as a solitary teen who regularly ditched class and had an interest in assault weapons he had been admitted to UCLA\'s psychiatric ward for a brief period.'),(42,'While he was in prison awaiting trial, he started acting bizarre by stripping naked and playing with his feces, apparently to avoid the death penalty. A state doctor testified that Dunlap was was faking his mental illness.'),(44,'Psychiatrists and others said he suffered from racial paranoia and was obsessed with nonexistent conspiracies. His landlord said he had \"delusions of grandeur.\"'),(45,'He had an abusive father, who committed suicide.'),(47,'He was down on his luck because of failed business decisions. One acquaintance said, \"He was the least likely guy you can imagine doing something like that.\"  His ex-wife said he \"hated violence.\"'),(48,'Lanza had a history of serious mental health problems that were known to his family and others, as detailed in a post-massacre investigation by Connecticut authorities.'),(49,'He stalked and harassed his colleague Laura Black for four years until she was granted a temporary restraining order aginst him. Before he was fired for his bizarre behavior, he was ordered to undergo psychological counseling.'),(50,'His family worried about his \"paranoia and delusions\" for at least two years prior, and tried to get him to seek treatment.'),(51,'The day before the shooting, he told child-support collection office workers that he was considering suicide. He had been convicted of felonious assault for pointing a revolver at police officers responding to a domestic violence report at this girlfriend\'s apartment.'),(52,'He suffered from paranoid delusions. A judge found that he suffered from \"extreme mental illness.\"'),(53,'He suffered violent physical abuse as a child. He claimed a teacher had sexually abused him, but the truth of that allegation was contested.'),(54,'His Army friends once broke into his apartment, fearing he\'d commit suicide in the \'90s. A psychiatric nurse who lived downstairs from Page said it was \"obvious\" he had a mental illness.'),(55,'He was worried he had inherited mental problems and rebuffed a pastor\'s suggestion he seek psychiatric counseling. His family members denied he had a history of mental illness.'),(56,'Police revoked his CCW permit after determining he was mentally unstable.'),(57,'The day before the shooting, he tried to make an appointment at a mental health clinic.'),(58,'He was described as darkly disturbed and isolated.'),(59,'Acquaintances described him as troubled, unstable, combative, and misogynistic. He made convenience store employees \"nervous.\"'),(60,'During his last meal with his wife, he confessed he was depressed and had visited psychiatric hospitals in Belgium.'),(61,'His second wife left him because he refused to seek psychological help. He had become increasingly isolated. One former student said he was \"off his rocker.\"'),(62,'Police speculated he had a \"grudge\" against the people he killed.'),(63,'Prior to the shooting, he had voluntarily checked into hospitals for mental problems at least twice and attempted suicide three times.'),(64,'He told a mental health professional he was \"struggling to resist actions on thoughts which are destructive in nature.\" He also suffered from alcoholism.'),(65,'He saw at least three mental health professionals before dropping out of his university.'),(66,'His family said he was mentally ill'),(67,'A former instructor at Oikos described him as \"mentally unstable\" and \"paranoid.\"'),(68,'His sister worried about his homicidal tendencies she said his mental health had been deteriorating and that he had threatened to commit suicide with his gun.'),(69,'He suffered from bipolar disorder, mood swings, and PTSD.'),(70,'He was diagnosed with paranoid schizophrenia as a teenager and feared demons were out to get him.'),(71,'His symptoms pointed to various possible mental illness diagnoses, such as schizophrenia and delusional disorder. He also experimented with pot and hallucinogens.'),(72,'He apparently was driven over the edge by unaddressed, ongoing racism against him at work'),(73,'He had a history of erratic, bizarre behavior. He once asked his family to get naked for 5 minutes on Sunday he said he thought the world would end and that he was Jesus.'),(74,'Medical officials at Walter Reed Army Medical Center and the Uniformed Services University of the Health Sciences raised concerns prior to the shooting regarding Hasan\'s aloof and erratic behavior and extremist Islamic views.'),(75,'He apparently harbored growing paranoia toward cops. He also sent a delusional letter to a local TV station right before the shooting.'),(76,'His estranged wife told her workplace that her husband had an \"unstable mental state or (was) mentally ill.\"'),(77,'He called his girlfriend two hours before the shooting to say he was going to kill his boss.'),(78,'He had a long history of mental health struggles after high school, his parents placed him at a psychiatric treatment center. He told friends he left the Army after six months due to a psychological discharge.'),(79,'He was known for histrionics and disruptions at city council meetings. His mounting debt was a stressor.'),(80,'He had been treated in the past for depression and ADHD.'),(81,'The families of victims filed a wrongful death lawsuit against the county arguing that the police department should have evaluated the gunman\'s mental health before hiring him.'),(82,'A district court ruled Cho was \"an imminent danger\" to himself and others as a result of mental illness two years earlier, and directed Cho to seek treatment.'),(83,'According to one relative, he was violent and had the mental capacity of a child. (But accounts from others did not indicate this about the shooter.)'),(84,'He told his wife that he\'d molested two young relatives 20 years ago.'),(85,'Police were unable to find any record that he had been treated for mental illness or was on psychiatric medication.'),(86,'She was placed on retirement disability for psychological reasons. Fellow employees described her behavior as increasingly bizarre. She believed the Postal Service employees were conspiring against her.'),(87,'He voluntarily visited a a psychiatric ward. He was hospitalized at least once for suicidal tendencies and was taking Prozac.'),(88,'Neighbors said he suffered from depression and had a drinking problem.'),(89,'He was discharged from the military because he was a paranoid schizophrenic.'),(90,'His cousin said he was depressed and \"going through a lot of things.\"'),(91,'He had a criminal past, including a sexual assault conviction.');
