INSERT INTO `summary` VALUES (1,'Stephen Craig Paddock, 64, rained a barrage of rapid gunfire down on thousands of concertgoers on the Las Vegas Strip late on a Sunday night, firing from a room on the 32nd floor of the Mandalay Bay Resort and Casinos. Shortly thereafter, he was found by law enforcement, deceased from a self-inflicted gunshot wound inside the hotel room.','Mass'),(2,'Michael McDermott, 42, opened fire on co-workers at Edgewater Technology and was later arrested.','Mass'),(3,'Jimmy Lam, 38, fatally shot three coworkers and wounded two others inside a UPS facility in San Francisco. Lam killed himself as law enforcement officers responded to the scene.','Mass'),(4,'Omar Mateen, 29, attacked the Pulse nighclub in Orlando in the early morning hours of June 12. He was killed by law enforcement who raided the club after a prolonged standoff.','Mass'),(5,'Randy Stair, a 24-year-old worker at Weis grocery fatally shot three of his fellow employees. He reportedly fired 59 rounds with a pair of shotguns before turning the gun on himself as another co-worker fled the scene for help and law enforcement responded.','Mass'),(6,'John Robert Neumann, Jr., 45, a former employee of manufacturer Fiamma Inc. fatally shot five workers at the company, and then killed himself on the scene. He\'d been fired from the company in April. The attack took place a week before the one-year anniversary of the Orlando nightclub massacre.','Mass'),(7,'Thomas Hartless, 43, shot and killed a former girlfriend and another employee of a nursing home, and then fatally shot the Kirkersville police chief responding to the scene. Hartless\' former girlfriend had recently obtained a court protection order against Hartless. Investigators later found more than 60 firearms in the home of Hartless, who was also found dead at the scene of the attack.','Mass'),(8,'Kori Ali Muhammad, 39, opened fire along a street in downtown Fresno, killing three people randomly in an alleged hate crime prior to being apprehended by police. Muhammad, who is black, killed three white victims and later described his attack as being racially motivated he also reportedly yelled \'Allahu Akbar\' at the time he was arrested, but authorities indicated they found no links to Islamist terrorism.','Spree'),(9,'Cedric L. Ford, who worked as a painter at a manufacturing company, shot victims from his car and at his workplace before being killed by police at the scene. Shortly before the rampage he had been served with a restraining order.','Spree'),(10,'Esteban Santiago, 26, flew from Alaska to Fort Lauderdale, where he opened fire in the baggage claim area of the airport, killing five and wounding six before police aprehended him.','Mass'),(11,'Arcan Cetin, 20, killed a teen girl and three women in the cosmetics section of a Macys department store at the Cascade Mall. A man was critically wounded in the shooting and taken to Harborview Medical Center in Seattle, where he died. Cetin was apprehended by police a few hours after the shooting while driving a car near his residence.','Mass'),(12,'Jason B. Dalton, a driver for Uber, apparently selected his victims randomly as he went on a rampage over several hours in three different locations, including five people he shot in the parking lot of a Cracker Barrel restaurant. He was \"arrested without incident\" at a downtown Kalamazoo bar about six hours after the rampage began.','Spree'),(13,'Gavin Long, a former Marine who served in Iraq, killed three police offers responding to a 911 call, and wounded three others. He was killed in a shoot-out with other officers responding to the scene. Prior to the attack, Long posted prolifically on social media, where he expressed admiration for the cop killer in Dallas 10 days prior.','Mass'),(14,'Micah Xavier Johnson, a 25-year-old Army veteran, targeted police at a peaceful Black Lives Matter protest, killing five officers and injuring nine others as well as two civilians. After a prolonged standoff in a downtown building, law enforcement killed Johnson using a robot-delivered bomb.','Mass'),(15,'Syed Rizwan Farook left a Christmas party held at Inland Regional Center, later returning with Tashfeen Malik and the two opened fire, killing 14 and wounding 21, ten critically. The two were later killed by police as they fled in an SUV.','Mass'),(16,'Robert Lewis Dear, 57, shot and killed a police officer and two citizens when he opened fire at a Planned Parenthood health clinic in Colorado Springs, Colorado. Nine others were wounded. Dear was arrested after an hours-long standoff with police.','Mass'),(17,'Hotel employee Silvio Leyva, 36, gunned down four coworkers at the Radisson Bay Harbor Inn before killing a woman outside who refused to give him her car. He was arrested shortly after the shootings.','Mass'),(18,'Byran Koji Uyesugi, 40, a Xerox service technician, opened fire inside the building with a 9mm Glock. He fled and was later apprehended by police.','Mass'),(19,'Larry Gene Ashbrook, 47, opened fire inside the Wedgwood Baptist Church during a prayer rally before committing suicide.','Mass'),(20,'Day trader Mark O. Barton, 44, who had recently lost a substantial sum of money, went on a shooting spree through two day-trading firms. He started at the All-Tech Investment Group, where he worked, then went on to Momentum Securities. He fled and hours later, after being cornered by police outside a gas station, committed suicide. (Two days before the spree, he killed his wife and two children with a hammer.)','Spree'),(21,'Eric Harris, 18, and Dylan Klebold, 17, opened fire throughout Columbine High School before committing suicide.','Mass'),(22,'Noah Harpham, 33, shot three people before dead in Colorado Springs before police killed him in a shootout.','Spree'),(23,'26-year-old Chris Harper Mercer opened fire at Umpqua Community College in southwest Oregon. The gunman shot himself to death after being wounded in a shootout with police.','Mass'),(24,'Kuwaiti-born Mohammod Youssuf Abdulazeez, 24, a naturalized US citizen, opened fire at a Naval reserve center, and then drove to a military recruitment office where he shot and killed four Marines and a Navy service member, and wounded a police officer and another military service member. He was then fatally shot in an exchange of gunfire with law enforcement officers responding to the attack.','Mass'),(25,'After he was expelled for having a gun in his locker, Kipland P. Kinkel, 15, a freshman at Thurston High, went on a shooting spree, killing his parents at home and two students at school. Five classmates wrestled Kipland to the ground before he was arrested.','Spree'),(26,'Dylann Storm Roof, 21, shot and killed 9 people after opening fire at the Emanuel AME Church in Charleston, South Carolina. According to a roommate, he had allegedly been planning something like that for six months.\"','Mass'),(27,'Mitchell Scott Johnson, 13, and Andrew Douglas Golden, 11, two juveniles, ambushed students and teachers as they left the school they were apprehended by police at the scene.','Mass'),(28,'Sergio Valencia del Toro, 27, in what officials say was a random act, shot and killed three people including an 11-year-old girl before turning the gun on himself.','Mass'),(29,'Lottery worker Matthew Beck, 35, gunned down four bosses over a salary dispute before committing suicide.','Mass'),(30,'Former Caltrans employee Arturo Reyes Torres, 41, opened fire at a maintenance yard after he was fired for allegedly selling government materials he\'d stolen from work. He was shot dead by police.','Mass'),(31,'Jaylen Fryberg, 15, using a .40-caliber Berretta, shot five \r\nstudents at Marysville High School, including two of his cousins and three friends, killing all but one. Fryberg arranged to meet them for lunch in the school cafeteria by text. Fryberg was reportedly well-liked at the school and there was not believed to be any ill-will between him and his victims. He committed suicide at the scene.','Mass'),(32,'Elliot Rodger, 22, shot three people to death in the college town of Isla Vista near the University of California, Santa Barbara. He also shot others as he drove around town, and injured others by striking them with is vehicle. He committed suicide by shooting himself in his car as police closed in. Prior to the rampage, Rodger stabbed three people to death at his apartment.','Spree'),(33,'Army Specialist Ivan Lopez, 34, opened fire at the Fort Hood Army Post in Texas, killing three and wounding at least 12 others before shooting himself in the head after engaging with military police. Lt. Gen. Mark A. Milley told reporters that Lopez \"had behavioral health and mental health\" issues.','Mass'),(34,'Ex-con Hastings Arthur Wise, 43, opened fire at the R.E. Phelon Company in retaliation for being fired after an argument with a supervisor. He attempted suicide by ingesting insecticide, failed, and was executed by the state of South Carolina eight years later.','Mass'),(35,'Cherie Lash Rhoades, 44, opened fire at the Cedarville Rancheria Tribal Office and Community Center, killing four and wounding two. After running out of ammunition, Rhoades grabbed a butcher knife and stabbed another person.','Mass'),(36,'Aaron Alexis, 34, a military veteran and contractor from Texas, opened fire in the Navy installation, killing 12 people and wounding 8 before being shot dead by police.','Mass'),(37,'Fired city park employee Clifton McCree, 41, opened fire on former coworkers he called \"racist devils\" inside their municipal trailer in an act of revenge after failing a drug test. He then committed suicide.','Mass'),(38,'Disgruntled former metallurgist James Daniel Simpson, 28, opened fire throughout the Walter Rossler Company where he had worked before exiting the building and committing suicide.','Mass'),(39,'Former airman Dean Allen Mellberg, 20, opened fire inside a hospital at the Fairchild Air Force Base before he was shot dead by a military police officer outside.','Mass'),(40,'Pedro Vargas, 42, set fire to his apartment, killed six people in the complex, and held another two hostages at gunpoint before a SWAT team stormed the building and fatally shot him.','Mass'),(41,'John Zawahri, 23, armed with a homemade assault rifle and high-capacity magazines, killed his brother and father at home and then headed to Santa Monica College, where he was eventually killed by police.','Spree'),(42,'Nathan Dunlap, 19, a recently fired Chuck E. Cheese\'s employee, went on a rampage through his former workplace and was arrested the following day. He now awaits execution on death row.','Mass'),(43,'Dennis Clark III, 27, shot and killed his girlfriend in their shared apartment, and then shot two witnesses in the building\'s parking lot and a third victim in another apartment, before being killed by police.','Mass'),(44,'Colin Ferguson, 35, opened fire on an eastbound Long Island Rail Road train as it approached a Garden City station. He was later arrested.','Mass'),(45,'Army Sgt. Kenneth Junior French, 22, opened fire inside Luigi\'s Italian restaurant while ranting about gays in the military before he was shot and arrested by police.','Mass'),(46,'Kurt Myers, 64, shot six people in neighboring towns, killing two in a barbershop and two at a car care business, before being killed by officers in a shootout after a nearly 19-hour standoff.','Spree'),(47,'Failed businessman Gian Luigi Ferri, 55, opened fire throughout an office building before he committed suicide inside as police pursued him.','Mass'),(48,'Adam Lanza, 20, shot his mother dead at their home then drove to Sandy Hook Elementary school. He forced his way inside and opened fire, killing 20 children and six adults before committing suicide.','Mass'),(49,'Former ESL Incorporated employee Richard Farley, 39, gunned down seven people at his former workplace. He was later arrested and now sits on death row at San Quentin.','Mass'),(50,'Andrew Engeldinger, 36, upon learning he was being fired, went on a shooting rampage, killing the business owner, three fellow employees, and a UPS driver. He then killed himself.','Mass'),(51,'John T. Miller, 50, killed four child-support workers in a county office building before turning the gun on himself.  Miller was upset about a court order garnishing his paycheck to cover overdue child-support payments.','Mass'),(52,'Retired librarian William Cruse, 59, was paranoid neighbors gossiped that he was gay. He drove to a Publix supermarket, killing two Florida Tech students en route before opening fire outside and killing a woman. He then drove to a Winn-Dixie supermarket and killed three more, including two police officers. Cruse was arrested after taking a hostage and died on death row in 2009.','Spree'),(53,'Former Lindhurst High School student Eric Houston, 20, angry about various personal failings, killed three students and a teacher at the school before surrendering to police after an eight-hour standoff. He was later sentenced to death.','Mass'),(54,'U.S. Army veteran Wade Michael Page, 40, opened fire in a Sikh gurdwara before he died from a self-inflicted gunshot would during a shootout with police.','Mass'),(55,'Postal worker Patrick Sherrill, 44, opened fire at a post office before committing suicide.','Mass'),(56,'Laid-off postal worker Thomas McIlvane, 31, opened fire at his former workplace before committing suicide.','Mass'),(57,'James Oliver Huberty, 41, opened fire in a McDonald\'s restaurant before he was shot dead by a police officer.','Mass'),(58,'Former graduate student Gang Lu, 28, went on a rampage on campus and then committed suicide at the scene.','Mass'),(59,'George Hennard, 35, drove his pickup truck into a Luby\'s cafeteria and opened fire before committing suicide.','Mass'),(60,'Abdelkrim Belachheb, 39, opened fire at an upscale nightclub after a woman rejected his advances. He was later arrested.','Mass'),(61,'Junior high school teacher Carl Robert Brown, 51, opened fire inside a welding shop and was later shot dead by a witness as he fled the scene.','Mass'),(62,'James Edward Pough, 42, opened fire at a General Motors Acceptance Corporation office before committing suicide. (The day prior, Pough killed a pimp and prostitute and injured two others. Those victims are not included in the mass murder count.)','Mass'),(63,'Joseph T. Wesbecker, 47, gunned down eight people at his former workplace before committing suicide.','Mass'),(64,'Patrick Purdy, 26, an alcoholic with a police record, launched an assault at Cleveland Elementary School, where many young Southeast Asian immigrants were enrolled. Purdy killed himself with a shot to the head.','Mass'),(65,'James Holmes, 24, opened fire in a movie theater during the opening night of \"The Dark Night Rises\" and was later arrested outside.','Mass'),(66,'Ian Stawicki, 40, gunned down four patrons at a cafe, and another person during a carjacking nearby, then shot himself as police closed in. (He died later that day in a Seattle hospital.)','Spree'),(67,'One L. Goh, 43, a former student, opened fire in a nursing classroom. He fled the scene by car and was arrested nearby a few hours later.','Mass'),(68,'Jeong Soo Paek, 59, returned to a Korean spa from which he\'d been kicked out after an altercation. He gunned down two of his sisters and their husbands before committing suicide.','Mass'),(69,'Scott Evans Dekraai, 42, opened fire inside a hair salon and was later arrested.','Mass'),(70,'Eduardo Sencion, 32, opened fire at an International House of Pancakes restaurant and later died from a self-inflicted gunshot wound.','Mass'),(71,'Jared Loughner, 22, opened fire outside a Safeway during a constituent meeting with Congresswoman Gabrielle Giffords (D-Ariz.) before he was subdued by bystanders and arrested.','Mass'),(72,'Omar S. Thornton, 34, shot up his Hartford Beer Distributor workplace after facing disciplinary issues, then committed suicide.','Mass'),(73,'Maurice Clemmons, 37, a felon who was out on bail for child-rape charges, entered a coffee shop on a Sunday morning and shot four police officers who had gone there to use their laptops before their shifts. Clemmons, who was wounded fleeing the scene, was later shot dead by a police officer in Seattle after a two-day manhunt.','Mass'),(74,'Army psychiatrist Nidal Malik Hasan, 39, opened fire on an Army base in an attack linked to Islamist extremism. Hasan was injured during the attack and later arrested.','Mass'),(75,'Jiverly Wong, 41, opened fire at an American Civic Association center for immigrants before committing suicide.','Mass'),(76,'Robert Stewart, 45, opened fire at a nursing home where his estranged wife worked before he was shot and arrested by a police officer.','Mass'),(77,'Disgruntled employee Wesley Neal Higdon, 25, shot up an Atlantis Plastics factory after he was escorted out of his workplace for an argument with a supervisor. Higdon shot the supervisor outside the factory before opening fire on coworkers inside. He then committed suicide.','Mass'),(78,'Steven Kazmierczak, 27, opened fire in a lecture hall, then shot and killed himself before police arrived.','Mass'),(79,'Charles \"Cookie\" Lee Thornton, 52, went on a rampage at the city hall before being shot and killed by police.','Mass'),(80,'Robert A. Hawkins, 19, opened fire inside Westroads Mall before committing suicide.','Mass'),(81,'Off-duty sheriff\'s deputy Tyler Peterson, 20, opened fire inside an apartment after an argument at a homecoming party. He fled the scene and later committed suicide.','Mass'),(82,'Virginia Tech student Seung-Hui Cho, 23, opened fire on his school\'s campus before committing suicide.','Mass'),(83,'Sulejman Talovi, 18, rampaged through the shopping center until he was shot dead by police.','Mass'),(84,'Charles Carl Roberts, 32, shot 10 young girls in a one-room schoolhouse in Bart Township, killing 5, before taking his own life.','Mass'),(85,'Kyle Aaron Huff, 28, opened fire at a rave afterparty in the Capitol Hill neighborhood of Seattle before committing suicide.','Mass'),(86,'Former postal worker Jennifer Sanmarco, 44, shot dead a former neighbor then drove to the mail processing plant where she used to work. Inside, she opened fire, killing six employees before committing suicide.','Spree'),(87,'Jeffrey Weise, 16, murdered his grandfather, who was a police officer, and grandfather\'s girlfriend. Weise then drove his grandfather\'s squad car to Red Lake Senior High School and opened fire on the reservation campus, killing another seven people before committing suicide.','Spree'),(88,'Living Church of God member Terry Michael Ratzmann, 44, opened fire at a church meeting at a Sheraton hotel before committing suicide.','Mass'),(89,'Nathan Gale, 25, possibly upset about the breakup of Pantera, gunned down former Pantera guitarist Dimebag Darrell and three others at a Damageplan show before a police officer fatally shot Gale.','Mass'),(90,'Assembly line worker Douglas Williams, 48, opened fire at his Lockheed Martin workplace in a racially motivated attack before committing suicide.','Mass'),(91,'Fired employee William D. Baker, 66, opened fire at his former Navistar workplace before committing suicide.','Mass');
