INSERT INTO `weapon_details` VALUES (1,'Yes','Two gun shops in Nevada','23 firearms, mostly rifles including scopes, and two modified for \"fully automatic\" firing two were mounted on tripods','AR-15-style and AK-47-style rifles and \"a large cache of ammunition\" four Daniel Defense DDM4 rifles, three FN-15s and other rifles made by Sig Sauer.'),(2,'Yes','Unknown','One semiautomatic handgun, one rifle (assault), one shotgun','.32-caliber Retolaza semiautomatic handgun AK-47 variant semiautomatic rifle 12-gauge Winchester 1300 pump-action shotgun'),(3,'No','Unclear the firearm was stolen in Utah. A second handgun Lam had (also stolen) was unused in the attack.','two handguns','MAC-10-style assault pistol 30-round magazine. An additional box of ammunition.'),(4,'Yes','Shooting center in Port St. Lucie, Florida','Semiautomatic rifle, semiautomatic handgun','Sig Sauer MCX rifle, Glock 17 9mm high-capacity magazines (30 rounds)'),(5,'Unknown','Unknown','shotguns','Unknown'),(6,'Unknown','Unknown','semiautomatic handgun','Unknown'),(7,'Unknown','Unknown','handgun, shotgun','Unknown'),(8,'Unknown','Unknown','handgun','.357 revolver'),(9,'Yes','Unknown','Semiautomatic rifle, semiautomatic handgun','Zastava Serbia AK-47-style rifle, Glock Model 22 .40-caliber handgun high-capacity magazines (30 rounds)'),(10,'Yes','Unknown','semiautomatic handgun\r\n','Walther 9mm semi-automatic pistol'),(11,'Unknown','Unknown','Rifle','Unknown'),(12,'Yes','Unknown','Semiautomatic handgun','9 mm handgun (ammo used unclear)'),(13,'Unknown','Unknown','Two semiautomatic rifles one semiautomatic handgun','IWI Tavor SAR 5.56 caliber rifle, Springfield XD 9, 9mm'),(14,'Yes','online and or gun show','Semiautomatic rifle, semiautomatic handguns','Izhmash-Saiga 5.45mm (AK-style) semiautomatic rifle with large capacity magazines Glock 9mm handgun, .25-caliber semiautomatic handgun'),(15,'\r\nYes','The suspects purchased their handguns in the United States the assault rifles were purchased by a third party.','Two assault rifles and two semi-automatic pistols were used in the attack. Police found a remote controlled explosive device at the scene of the crime. At the home were 12 pipe bombs, 2,500 rounds for the AR-15 variants, 2,000 rounds for the pistols, and several hundred for a .22 calibre rifle. In the suspects\' car were an additional 1,400 rounds for the rifles and 200 for the handguns.','Two semiautomatic AR-15-style rifles one a DPMS A-15, the other a Smith & Wesson M&P15, both with .223 calibre ammunition. Two 9mm semiautomatic handguns. High capacity magazines.'),(16,'Unknown','Unclear','Long gun','Reportedly an AK-47 style semiautomatic rifle and others. Authorities had not released details on Dear\'s weapons as of April 2016.'),(17,'Yes','One purchased from Big E\'s in Tampa, Fla.','One semiautomatic handgun, one revolver','9mm Lorcin semiautomatic handgun .38-caliber Charter Arms revolver'),(18,'Yes','Hunting Supplies of Hawaii (The Armory) in Honolulu, Hawaii','One semiautomatic handgun','9mm Glock 17 semiautomatic handgun'),(19,'Yes','Trader\'s Village flea market in Grand Prairie, Texas','Two semiautomatic handguns','.380-caliber, 9mm Ruger P85 semiautomatic handguns'),(20,'Yes','Glock purchased from gun store in Warner Robins, Ga.','Three semiautomatic handguns, one revolver','.45-caliber Colt 1911-A1, 9mm Glock 17, .25-caliber Raven Arms MP-25 semiautomatic handguns .22-caliber Harrington & Richardson revolver'),(21,'No','Purchased variously at Tanner Gun Show in Denver, Colo. and from an individual','One semiautomatic handgun (assault), one rifle (assault), two shotguns','9mm Intratec DC-9 semiautomatic handgun 9mm Hi-Point 995 carbine rifle 12-gauge sawed-off Savage Stevens 311D, 12-gauge sawed-off Savage Springfield 67H pump-action shotguns'),(22,'Yes','Unclear','Two handguns and a rifle','AR-15 rifle, a 9 mm pistol, and a .357 revolver'),(23,'Yes','From the home he shared with his mother. All were legally obtained by either Harper-Mercer o